/* eslint no-unused-vars: 0 */
import ifDefined from '@ui5/webcomponents-base/dist/renderer/ifDefined.js';
import { html, svg, repeat, classMap, styleMap, unsafeHTML, setTags, setSuffix } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';
const block0 = (context) => { return html`<div class="ui5-badge-root" dir="${ifDefined(context.effectiveDir)}">${ context.hasIcon ? block1(context) : undefined }${ context.hasText ? block2(context) : undefined }<span class="ui5-hidden-text">${ifDefined(context.badgeDescription)}</span></div>`; };
const block1 = (context) => { return html`<slot name="icon"></slot>`; };
const block2 = (context) => { return html`<label class="ui5-badge-text"><bdi><slot></slot></bdi></label>`; };


const main = (context, tags, suffix) => {
	setTags(tags);
	setSuffix(suffix);
	return block0(context);
};

export default main;
